import React, { Component } from 'react';

class Drinformation extends Component {
    constructor(props) {
        super(props);
        this.state = {
            doctors: [],
            isLoaded: false,

        };
    }
    componentDidMount() {
        fetch('https://api.betterdoctor.com/2016-03-01/doctors?specialty_uid=${specialty}&insurance_uid=${insurance}&location=${lat}%2C${lng}%2C10&user_location=${lat}%2C${lng}&sort=distance-asc&skip=${skip}&limit=${limit}&user_key=ff5d654bef674612132ad54458bfb6a5')
            .then(res => res.json())
            .then(json => {
                this.setState({
                    isLoaded: true,
                    doctors: json,
                })

            })
            .catch(error => console.log(error))
    }

    render() {
        return (
            <div>

            </div>
        );
    }
}

export default Drinformation;
